import React, { useEffect, useState } from 'react'

const App =()=>{

  const [items,setItems]=useState([])

// pull the overall item list
  useEffect(()=>{
    fetch("http://localhost:3001")
    .then(res=>res.json())
    .then(data=>setItems(data))
  },[])

return (

  <>
    {items.map(item=><div>{item}</div>)}
  </>
)

}
